import { useState } from 'react';
import '../css/Popup.css';

export default function Popup(params) {
    let [active,setActivity] = useState(params.inactive);
    const closePopup=()=>{
        setActivity(0);
    }
    console.log(params.inactive);
    return (
        <>
            <div className={`container-fluid panel-parent ${active==0 || params.inactive == 0?"d-none":""}`}>
                <div className='panel'>
                    <div className='container'>
                        <button className='btn close-btn' onClick={closePopup}>X</button>

                    </div>
                </div>
            </div>
        </>
    )

}
